import './App.css';
import Records from './components/Records';
import AddUser from './components/AddUser';

import { BrowserRouter,Routes,Route, createBrowserRouter ,RouteProvider} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" exact Component={Records}/>

        <Route path="/getUsers" Component={AddUser} />
      </Routes>
    </BrowserRouter>

  );
}

export default App;
